import {React, Component} from 'react'
import './App.css';
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import app from './components/app'
class App extends Component {
  render(){
  return (
   <Router>
     <Route path="/" component={app} exact/>
   </Router>

  );}
}

export default App;
